import React, {Component} from "react";
import BorderWrapper from "react-border-wrapper";


class Example extends React.Component {
    render () {
      return (
        <BorderWrapper
            borderColour="#"
            borderWidth="5px"
            borderRadius="15px"
            borderType="Solid"
            innerPadding=""
            >

        </BorderWrapper>
      )
    }
  }
